    componentDidMount() {
        var videoUrl = 'ws://localhost:9999/';
        var player = new JSMpeg.VideoElement('#video-canvas', videoUrl, { autoplay: true });
        console.log(player);
    }

    render() {

        return ( <
            div id = "video-canvas"
            style = {
                { height: '1080px', width: '1920px' }
            } >

            <
            /div>
        );
    }

}

export default App;
